def minDominoRotations(A, B):
        num = [0, 0]
        same =[0, 0]
        for flag_idx in range(2):
            flag = [A[0], B[0]][flag_idx]
            for idx in range(len(A)):
                if flag == A[idx]:
                    pass
                elif flag == B[idx]:
                    num[flag_idx] += 1
                else:
                    num[flag_idx] = -1
                    break
                if A[idx] == B[idx]:
                    same[flag_idx] += 1
        if num[0] == -1 and num[1] == -1:
            return -1
        elif num[0] == -1:
            same_ = max(same)
            return min(num[1], len(A)-same_-num[1])
        elif num[1] == -1:
            same_ = max(same)
            return min(num[0], len(A)-same_-num[0])
        else:
            same_ = max(same)
            return min([ e for e in [ num[1], len(A)-same_-num[1], num[0], len(A)-same_-num[0]] if e >= 0 ])

